export default class Loading extends Component {
  show() {
    return <loading>loading</loading>
  }

  styles = {
    loading: {
      width: "100%",
      height: "100%",
      alignItems: "center",
      justifyContent: "center",
      fontSize: 22,
      opacity: 0.7,
    },
  }
}
